import React from "react";
import { Link } from "react-router-dom";
import ProductDetails from "./ProductDetails";

function Components() {
  console.log(ProductDetails);

  const trendingArray = ProductDetails.filter((value) => value.length *= 2);
  console.log(trendingArray);
  return (
    <div className="component-2">
      <div className="components">
        <img src="Shirt\kurta.jpg" alt="shoes1" />
        <h3>
          {" "}
          <Link to="/shirt/kurta">Kurta</Link>
        </h3>
      </div>
      <div className="components">
        <img src="Shirt\formal.jpg" alt="shoes1" />
        <h3>
          {" "}
          <Link to="/shirt">Formal</Link>
        </h3>
      </div>
      <div className="components">
        <img src="Shirt\casual.jpg" alt="shoes1" />
        <h3>
          {" "}
          <Link to="/shirt">Casual</Link>
        </h3>
      </div>
    </div>
  );
}

export default Components;
